import { initialState } from './initialState';

function selectedProgramReducer(state = initialState, action) {
  switch (action.type) {
    case 'SET_SELECTED_PROGRAM':
      return updatedState;

    default:
      return state;
  }
}

export { selectedProgramReducer };
